import React, { useState } from "react";

const Calculate = () => {
  const [weight, setWeight] = useState("");
  const [height, setHeight] = useState("");
  const [age, setAge] = useState("");
  const [gender, setGender] = useState("male");
  const [bmiResult, setBmiResult] = useState("");
  const [calorieResult, setCalorieResult] = useState("");

  // BMI Calculation
  const calculateBMI = () => {
    if (weight && height) {
      const heightInMeter = height / 100;
      const bmi = weight / (heightInMeter * heightInMeter);
      let category = "";

      if (bmi < 18.5) category = "Underweight";
      else if (bmi >= 18.5 && bmi < 24.9) category = "Normal weight";
      else if (bmi >= 25 && bmi < 29.9) category = "Overweight";
      else category = "Obese";

      setBmiResult(`Your BMI is ${bmi.toFixed(2)} (${category})`);
    } else {
      setBmiResult("Please enter valid weight and height.");
    }
  };

  // Calorie Calculation (BMR Formula)
  const calculateCalories = () => {
    if (weight && height && age) {
      let bmr = 0;
      if (gender === "male") {
        bmr = 10 * weight + 6.25 * height - 5 * age + 5;
      } else {
        bmr = 10 * weight + 6.25 * height - 5 * age - 161;
      }
      setCalorieResult(`Your estimated daily calorie needs: ${Math.round(bmr)} kcal`);
    } else {
      setCalorieResult("Please fill in all fields for calorie calculation.");
    }
  };

  return (
    <div className="container mt-5 p-4 rounded shadow">
      <h2 className="text-center fw-bold" style={{ color: "#1976d2" }}>
        ⚖️ BMI & Calorie Calculator
      </h2>
      <p className="text-center text-muted fs-5 mb-4">
        Analyze your BMI and calories to maintain a balanced diet and healthy lifestyle!
      </p>

      <div className="row g-4">
        {/* Input Fields */}
        <div className="col-md-6">
          <label className="form-label fw-semibold">Weight (kg):</label>
          <input
            type="number"
            className="form-control"
            value={weight}
            onChange={(e) => setWeight(e.target.value)}
            placeholder="Eg: 70"
          />
        </div>

        <div className="col-md-6">
          <label className="form-label fw-semibold">Height (cm):</label>
          <input
            type="number"
            className="form-control"
            value={height}
            onChange={(e) => setHeight(e.target.value)}
            placeholder="Eg: 170"
          />
        </div>

        <div className="col-md-6">
          <label className="form-label fw-semibold">Age:</label>
          <input
            type="number"
            className="form-control"
            value={age}
            onChange={(e) => setAge(e.target.value)}
            placeholder="Eg: 25"
          />
        </div>

        <div className="col-md-6">
          <label className="form-label fw-semibold">Gender:</label>
          <select
            className="form-select"
            value={gender}
            onChange={(e) => setGender(e.target.value)}
          >
            <option value="male">Male</option>
            <option value="female">Female</option>
          </select>
        </div>
      </div>

      {/* Action Buttons */}
      <div className="text-center mt-4">
        <button className="btn btn-primary me-3 px-4" onClick={calculateBMI}>
          Calculate BMI
        </button>
        <button className="btn btn-success px-4" onClick={calculateCalories}>
          Calculate Calories
        </button>
      </div>

      {/* Results */}
      {bmiResult && (
        <div className="alert alert-info mt-4 fw-semibold" role="alert">
          {bmiResult}
        </div>
      )}
      {calorieResult && (
        <div className="alert alert-warning mt-3 fw-semibold" role="alert">
          {calorieResult}
        </div>
      )}
    </div>
  );
};

export default Calculate;
